import Profile from '../views/user/Profile'
import Login from '../views/user/Login'
export default [
    {
      path: '/',
      name: 'Login',
      component: Login,
    },
   {
      path: '/profile',
      name: 'Profile',
      component: Profile,
    }
   ]
